INSERT INTO `webadminsiteapp_products` (`proid`, `proname`, `prodescription`, `proprice`, `propercentage`, `prostock`, `procolor`, `proimage1`, `proimage2`, `proimage3`, `proimage4`, `proimage5`, `removestate`, `bid_id`, `cid_id`, `prormdate`, `prodate`, `procolorname`, `clothes_gender`, `clothes_size`, `ram`, `rom`, `watch_type`) VALUES
('005ca1b59f814def94cc03531f1641ef', 'Infinix X1 Slim Series Core i3 10th Gen - (8 GB/256 GB SSD/Windows 11 Home) XL21 Thin and Light Laptop (14-inch, Aurora Green, 1.24 kg)', '<p><strong>Descriptions</strong></p><ul><li>Stylish &amp; Portable Thin and Light Laptop</li><li>14-inch FHD, IPS Display (300nits peak brightness, 100% sRGB, NTSC 72%)</li><li>Light Laptop without Optical Disk Drive</li><li>Keep your work peers gazing at you as you carry along the metal crafted and stylish Infinix INBook X1 Slim Laptop to your workplace.</li><li>This laptop features a slim body with a weight of about 1.24 kg and thickness of around 14.8 mm to ensure easy portability and a classy appearance.</li><li>Also, thanks to the 65 W multi-utility USB Type-C fast charger, you can charge your device to up to 60% in about 55 minutes.</li><li>Moreover, utility features such as in-built Windows 11 OS, backlit keyboard, and a Dual-star light camera make it a delight for you to use this laptop.</li></ul><p><strong>Sleek and Elegant Design</strong></p><ul><li>Crafted with a lightweight and slim Al- Alloy metal body, the Infinix INBook X1 Slim Laptop adds a classy and sophisticated look, which is sure to gain the attention of the onlookers wherever you go. And with a weight of merely 1.24 kg and thickness of around 14.8 mm, this laptop makes it easy for you to take with you whenever you are travelling.</li></ul><p><strong>Effortless Fast Charging Adapter</strong></p><ul><li>This laptop comes with a 65 W USB Type-C fast charger that ensures up to 60% charging in 55 minutes, thus freeing you from the worry of constantly plugging in to your charging port. Moreover, this multi-utility charger lets you use it to juice up your smartphone, thus, eliminating the need to carry a separate charger</li></ul><p><strong>Sustainable Battery Life</strong></p><ul><li>Keep yourself entertained for up to 10 hours without the hassle of looking out for a power supply to charge your laptop, thanks to the 50 Wh long-lasting battery capacity. As a result, you can stay connected to your work, study, or your entertainment throughout the day.</li></ul><p><strong>Captivating Display</strong></p><ul><li>Sporting a 35.56 cm (14) FHD display with 100% sRGB Color Gamut and a peak brightness of 300 nits, this laptop renders vibrant, sharp, and accurate colours. Also, it features a sleek 4.7 mm ultra-thin bezel display design to let you take pleasure in an expansive view, this offering an engaging visual experience.</li></ul><p><strong>Enthralling Processor</strong></p><ul><li>Powered by the high-performing Intel Core processor chip, high RAM, ample storage capacity, and 4266 MHz of memory frequency, this laptop allows you to seamlessly browse through multiple apps with minimal lag. Moreover, it is integrated with an NVMe PCIe 3.0 SSD, that lets you enjoy blazing-fast transfer speeds, boot times, and game-loading, thus ensuring a smooth user performance.</li></ul><p><strong>Multiple Connectivity Ports</strong></p><ul><li>Boasting a plethora of USB ports such as 1 x USB-C, 1 x USB-C (Data Transfer), 1 x USB3.0, 1 x HDMI 1.4, dedicated SD Card Slot, one 3.5 mm headset, and microphone jack, this laptop allows you to conveniently accomplish all your personal and business needs. Thus, you do not need a separate dongle to get your things done.</li></ul><p><strong>Integrated Windows 11 OS</strong></p><ul><li>The pre-installed Windows 11 OS Home on this laptop brings about a range of additional utility services tools, and its advanced UI lets you effortlessly complete multiple computing tasks.</li></ul><p><strong>Dazzling Dual-star Light Camera</strong></p><ul><li>Employed with Dual-star LED fill lights in its camera, this laptop ensures a perfect appearance making during a live conference or video chatting.</li></ul><p><strong>Dazzling Dual-star Light Camera</strong></p><ul><li>Employed with Dual-star LED fill lights in its camera, this laptop ensures a perfect appearance making during a live conference or video chatting.</li></ul><p><strong>Immersive Audio Experience</strong></p><ul><li>Thanks to the DTS Audio processing feature, you can indulge in a realistic and extraordinary aural experience. Moreover, this laptop is equipped with four speakers that lets you experience a 360-degree surround sound, thus ensuring an theatrical audio experience.</li></ul>', 29990, 0, 140, '#3a7787', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_Dlre8En.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_jxIr0zR.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_kuXuFED.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_NXweRq2.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_TgJw8ff.jpg', 0, 'fb737fdf8fda408ca90881dd93318e87', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-18 10:07:23.713991', '2022-12-01 16:52:38.841037', 'Aurora Green', 'No', 'No', '8GB', '256GB', 'No'),
