('1f67c3d98d6c4fed94f949cadc40e84a', 'APPLE Watch Series 3 (GPS, 42mm) - Space Grey Aluminium Case with Black Sport Band (Black Strap, Regular)', '<p><strong>Descriptions:</strong></p><ul><li>GPS</li><li>Retina display</li><li>Swim proof</li><li>Optical heart sensor</li><li>Store and stream music</li><li>Podcasts and audiobooks</li><li>Elevation</li><li>Emergency SOS</li><li>Touchscreen</li><li>Notifier, Fitness &amp; Outdoor</li><li>Battery Runtime: Up to 18hrs</li></ul><p><strong>Other Details:</strong></p><ul><li>Check your heart rate and get notifications for low and high heart rate and irregular rhythm.&nbsp;</li><li>Measure your workouts, and track and share your activity.&nbsp;</li><li>Take calls, send and receive messages, and listen to your favorite songs from Apple Music.&nbsp;</li><li>Apple Watch Series 3 lets you do it all right from your wrist.</li></ul><p><strong>The Ultimate Sports Watch</strong></p><ul><li>Challenge yourself to explore new heights and keep track of your feats with the GPS and altimeter.&nbsp;</li><li>Grueling physical tasks are bearable when you have a backup of your favorite tracks saved on your watch.&nbsp;</li><li>The Apple Watch Series 3 is also swim proof and can be worn in the pool or out in the ocean.&nbsp;</li><li>Track the progress of your workouts, from casual jogs and intense cycle rides to everything in between on your smartwatch.</li></ul><p><strong>Intelligent Activity Tracker</strong></p><ul><li>Keep tabs on how active you are each day with the watch\'s three activity rings.&nbsp;</li><li>Smart Coaching brings you personalized progress updates in the mornings, and suggestions on how to close your rings in the evenings to help you stay motivated.&nbsp;</li><li>Share your activity log with friends to compete with them and cheer them on.&nbsp;</li><li>The Apple Watch celebrates each milestone with you.</li></ul><p><strong>Powerful Health Tool</strong></p><ul><li>Keep tabs on your heart rate when you\'re walking, resting, 