('30f1fee3a44d444faae6401133c38013', 'Lenovo IdeaPad 3 Core i3 11th Gen - (8 GB/512 GB SSD/Windows 11 Home) 82H801L7IN | 82H802FJIN | 82H802L3IN | 82H801LHIN Thin and Light Laptop  (15.6 inch, Arctic Grey, 1.65 kg, With MS Office)', '<p><strong>Descriptions:</strong></p><ul><li>Stylish &amp; Portable Thin and Light Laptop&nbsp;</li><li>15.6-inch Full HD TN 250nits Anti-glare&nbsp;</li><li>Light Laptop without Optical Disk Drive&nbsp;</li><li>Get an opportunity to work anytime and from anywhere as you bring home the Lenovo IdeaPad 3 Core i3 11th Gen laptop.&nbsp;</li><li>It features a slim 19.9 mm body and weight of about 1.41 kg to ensure flexible portability and stylish looks no matter where you go.&nbsp;</li><li>Also, its 35.56 cm (14) Full HD display with four-sided narrow bezels renders immersive visuals.&nbsp;</li><li>Moreover, this laptop is powered by an 11th generation processor and high-speed SSD storage that allows you to enjoy efficient performance and massive storage.</li></ul><p><strong>Travel-friendly Design</strong></p><ul><li>Ideal for business travelers or someone who is always on the go, the Lenovo IdeaPad 3 Core i3 11th Gen laptop comes with a compact weight of around 1.65 kg and body thickness of 19.9 mm so that you can take it whenever you want and keep working on it even when you are traveling.</li></ul><p><strong>Unmatched Performance</strong></p><ul><li>The Intel 11th generation processor and high-speed SSD storage featured in this laptop offers you incredible performance and an efficient data storage speed. As a result, you can easily browse through heavy duty applications and enjoy safe data storage without any hassles.</li></ul><p><strong>Durable Battery</strong></p><ul><li>Boasting a powerful 3 Cell 45Wh Battery, this laptop lets you explore and indulge in your daily working sessions or online classes without worrying about frequently charging it. And, when you feel that the battery is running out of juice, the Rapid Charging technology will have you covered and running within a short time.</li></ul><p><strong>Stunning Camera and Audio</strong></p><ul><li>Whether you are up for your online classes or video conference this laptop will make it a breeze for you with its 720p HD camera, privacy shutter, and Dolby Audio, thus ensuring crystal clear visuals and sharp sound.</li></ul><p><strong>Compatible Connectivity Options</strong></p><ul><li>Fitted with a wide range of connectivity options such as USB-C port, this laptop efficiently eliminates the need to use various adaptors to connect peripherals. And, the integrated Wi-fi 5.0 and Bluetooth 5.0 connection makes your video calling, streaming and gaming experiences seamless.</li></ul><p><strong>Convenient AI-enabled Features</strong></p><ul><li>Thanks to the AI-based software you can enjoy hassle-free operations while working or learning from home. It features a Lenovo Aware function that alerts you regarding Attention, Posture, and Breaks to ensure being attentive throughout your online video session. Moreover, the Lenovo Eye Care and Noise Canceling feature of this laptop facilitates clear communication and comfortable viewing.</li></ul>', 38799, 0, 148, '#828282', 'ProductsImages/Lenovo_IdeaPad_3_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_Thin__ztdL1H2.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_Thin__L2bAoyP.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_Thin__mwFY9SI.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_Thin__mqB5VMG.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_Thin__ogZy4zc.jpg', 0, '3fc08426d68c4153850c260018f2c315', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-04 08:09:38.796322', '2022-12-01 16:52:38.841037', 'Gray', 'No', 'No', '8GB', '512GB', 'No'),
