('357f23807e6045e693cbabf0bdbfe4e6', 'DELL Core i3 11th Gen - (8 GB/256 GB SSD/Windows 11 Home) Vostro 3420 Notebook  (14 inch, Carbon Black, 1.48 Kg, With MS Office)', '<p><strong>Descriptions:</strong></p><ul><li>14-inch FHD, WVA AG Narrow Border 250 nits&nbsp;</li><li>Light Laptop without Optical Disk Drive</li><li>You can keep yourself entertained with movies and games and complete your daily computing tasks using the Dell Vostro 3420 Laptop.&nbsp;</li><li>It employs Dell Comfort View technology to reduce harmful and strenuous blue light, keeping your eyes comfortable even during long screen time.&nbsp;</li><li>Also, this laptops full-sized keyboard and big touchpad are spill-resistant and offer convenience and ease while working.&nbsp;</li><li>Moreover, its FHD display panel provides enhanced brightness and realistic colors, making the scenes appear clear and captivating.</li></ul><p><strong>Improve Productivity</strong></p><ul><li>Featuring Dell Comfort View software technology, the Dell Vostro 3420 Laptop minimizes blue light emissions, which could be harmful to your eyes. So, you can work on this laptop for long hours without straining your eyes. Additionally, this laptops full-size keyboard with a large touchpad enables easy working. And, as the touchpad and keyboard are spill-resistant, dropping food or liquids will not damage them. Furthermore, with an FHD display panel, this device enhances brightness and produces realistic colors to make scenes look dynamic.</li></ul><p><strong>Processor and Battery Features</strong></p><ul><li>Integrated with an 11th Gen Intel Core processor, this laptop makes daily computing tasks easy and smooth. Also, its SSD storage ensures fast and seamless performance. In addition, with Express Charge, this laptop can reach up to 80% in just one hour of charging, letting you carry on with multiple tasks.</li></ul><p><strong>Safety Features</strong></p><ul><li>Trusted Platform Module 2.0 is a commercial security chip installed on 