tion</strong></p><ul><li>The Idea pad Slim 3i can give you an entirely immersive experience. Furthermore, Dolby Audio could intensify a romantic evening or keep you on the edge of your seat during a game.</li></ul><p><strong>Monstrous Battery</strong></p><ul><li>You get up to 9 hours of battery life with the Idea pad Slim 3i, so you\'re always prepared. You can quickly and simply choose between \"Max Mode,\" in which your CPU produces output quickly, and \"Battery Saving Mode,\" for power that lasts for a considerable amount of time, using Q Control.</li></ul><p><strong>Unmatched Connection</strong></p><ul><li>Watch your favorite shows on the weekends while using the lightning-fast 2x2 Wi-Fi 5. While you rest and unwind, take advantage of the seamless entertainment that the uninterrupted connection provides. Additionally, the unique Bluetooth 5.0 version allows for quick connections and efficient task completion.</li></ul><p><strong>Enriched User Experience</strong></p><ul><li>The Lenovo Vantage on this laptop makes life easy for a better user experience by utilizing features like power-saving, charging restrictions, and regular software upgrades.</li></ul>', 29980, 0, 150, '#b0b0b0', 'ProductsImages/Lenovo_IdeaPad_3_Celeron_Dual_Core_-_8_GB_256_GB_SSD_Windows_11_Home_-_1.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Celeron_Dual_Core_-_8_GB_256_GB_SSD_Windows_11_Home_-_2.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Celeron_Dual_Core_-_8_GB_256_GB_SSD_Windows_11_Home_-_3.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Celeron_Dual_Core_-_8_GB_256_GB_SSD_Windows_11_Home_-_4.jpg', 'ProductsImages/Lenovo_IdeaPad_3_Celeron_Dual_Core_-_8_GB_256_GB_SSD_Windows_11_Home_-_5.jpg', 0, '3fc08426d68c4153850c260018f2c315', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-04 08:09:38.796322', '2022-12-01 16:52:38.841037', 'Gray', 'No', 'No', '8GB', '256GB', 'No'),
('4aebd52c66924dc3b3162e651da56fb6', 'OPPO K10 5G (Ocean Blue, 128 GB)  (8 GB RAM)', '<p><strong>Description:</strong></p><ul><li>8 GB RAM</li><li>128 GB ROM</li><li>Expandable Up to 1 TB&nbsp;</li><li>16.66 cm (6.56 inch) HD+ Display&nbsp;</li><li>48MP + 2MP | 8MP Front Camera&nbsp;</li><li>5000 mAh Lithium Ion Polymer Battery&nbsp;</li><li>Mediatek Dimensity 810 Processor</li></ul><p><strong>Slender Design</strong></p><ul><li>With its comforting and elegant build, the Oppo K10 5G brings trend to its core essence. This phone boasts a simple and lightweight design with an outstanding intuitive style. Furthermore, with excellent abrasion and wear resistance, this smartphone proves to be tough and durable, keeping you on your toes constantly.</li></ul><p><strong>33 W SUPERVOOC Charging Superiority</strong></p><ul><li>The Oppo K10 5G sports 33 W SUPERVOOC charging innovation with excellent temperature management and hardware protection, which allows you to charge your phone up to 53% in about 30 minutes and up to 100% in around 69 minutes. This way, you can stay on top of your game without clinging to the charging wire.</li></ul><p><strong>Terrific Battery</strong></p><ul><li>Thanks to the humongous 5000mAh battery with Super Power Saving Mode and overnight standby, you can seamlessly enjoy up to 20.52 hours of talk time on a full charge and conveniently use WhatsApp for 1.2 hours after the battery reaches 5%. Thus, you can achieve peak performance without being anxious about the battery life.</li></ul><p><strong>Powerful Processor</strong></p><ul><li>The phone\'s unique Dimensity 810 chipset operates admirably while consuming extremely little power. Furthermore, the unique 5G chip with a 6 nm design provides a smooth operation and great efficiency even under tough conditions.</li></ul><p><strong>Stupendous RAM Expansion Technology</strong></p><ul><li>With amazing RAM Expansion technology that offers up to 8 GB +5 GB of RAM, you can effortlessly enjoy multitasking and appreciate steady performance by momentarily delving into available storage space and using it as working memory, enhancing the user experience. Moreover, with 128 GB of internal storage, you can save your memorable moments without any apprehension.</li></ul><p><strong>Robust Build</strong></p><ul><li>This smartphone undergoes a series of quality testing before coming into your hands. Thanks to the IPX4 water resistance rating, you can carry your phone wherever you go without worrying about spills and splashes. Moreover, the Micro-dop testing and humidity resistance testing ensures that your phone is always protected from any potential threats.</li></ul><p><strong>Elevated Audio</strong></p><ul><li>Thanks to a trailblazing synchronization of super-linear stereo speakers that generate dual-channel surround sound with specific tweaking for various modes, you can experience comprehensive, incredibly brilliant, and immersive music on this remarkable phone.</li></ul><p><strong>Unmatched Volume Control</strong></p><ul><li>Ultra-Volume Mode of this phone allows you to play music, ringtones, alarms, and messages at a high volume without compromising performance, precision, or pleasure. This way, you can easily double the volume of the source while maintaining the spectrum and richness.</li></ul><p><strong>Splendid Refresh Rate</strong></p><ul><li>The DCI-P3 gamut is extensively represented by the Oppo K10 5G, offering you a rich and realistic color experience that is as vibrant as what you see in real life. Furthermore, the 90Hz refresh rate of this phone offers seamless navigation and strong responsiveness.</li></ul><p><strong>Incredible Photography</strong></p><ul><li>The 48 MP Main Camera with a 2 MP Depth Camera equipped with this phone, empowers you to capture mesmerising images with enthralling imagery. This way, you can preserve those precious moments with a gentle click.</li></ul><p><strong>Colour-rich Imagery</strong></p><ul><li>The sophisticated technology in the 