('68f6b93fdd004efb9f978950e6191961', 'Moto G71 5G (Neptune Green, 128 GB) (6 GB RAM)', '<p><strong>Description:</strong></p><ul><li>6 GB RAM | 128 GB ROM</li><li>16.26 cm (6.4 inch) Full HD+ AMOLED Display</li><li>50MP + 8MP + 2MP | 16MP Front Camera</li><li>5000 mAh Lithium-ion Polymer Battery</li><li>Qualcomm Snapdragon 695 Processor</li></ul><p><strong>Powerful Qualcomm Snapdragon 695 Processor</strong></p><ul><li>The moto g71 5G features a Qualcomm Snapdragon 695 5G processor that delivers fast graphics card performance, thus transforming your gaming experience into a realistic one. Also, this mobile phone comes with up to 6 GB of RAM and an additional expandable 1.5 GB of RAM so that you can seamlessly multitask between apps.</li></ul><p><strong>True 5G with 13 Global 5G Bands</strong></p><ul><li>Enjoy connecting to blazing-fast 5G networks and download your favorite shows within a few seconds, and stream videos with a significant lag, as this moto g71 mobile phone comes with a fast 5G connection.</li></ul><p><strong>Smooth and Vibrant Display</strong></p><ul><li>Experience every content coming back to life on the 16.25 cm (6.4) AMOLED FHD display that comes with a 409 PPI pixel density and can reach up to 700 nits\' brightness. As a result, you can enjoy crystal-clear visuals featuring dark blacks for enhanced brightness and contrasts.</li></ul><p><br><strong>Think Shield Security for Mobile</strong></p><ul><li>Stay protected with the Think Shield security on this moto g71 5G mobile phone. This business-grade security helps to safeguard your data from malware, phishing, and other threats with the help of multiple layers of protection and advanced security.</li></ul><p><strong>50 MP Quad Function Camera</strong></p><ul><li>Flaunt your 50 MP Quad Function camera system that lets you capture your special moments in vividly clear shots under any light. And, with its 8 MP Ultrawide, 8 MP Depth Sensor and Macro Vision Camera, you can capture low-light photos as well as detailed close-ups shots.</li></ul><p><strong>Blazing-fast 5000 mAh Battery</strong></p><ul><li>You don\'t have to be tired of your phones battery running out soon, thanks to the massive 5000 mAh battery. Work, play games, stream movies, video chat with your friends, and do more for up to 30 hours on a single full charge. And, with 33 W Turbo Power charging, your phone gets charged up in just 30 minutes so that you can go back to using your phone as soon as possible.</li></ul><p><strong>Stunning Design</strong></p><ul><li>This mobile phone comes with a curved body featuring rounded corners so that you can enjoy immersive usage on its expanded screen as well as enjoy good looks while you carry it outside.</li></ul><p><strong>Massive Storage Capacity</strong></p><ul><li>Thanks to the built-in 128 GB of storage capacity on this mobile phone, you have ample space for storing your favorite photos, videos, and other necessities in one place.</li></ul><p><strong>Near-stock Android Experience</strong></p><ul><li>You dont have to go through the hassle of duplicate apps and clunky ads, as this mobile comes with a near-stock Android experience that allows you to manage your privacy settings, conversations, and more.</li></ul><p><strong>IP52-rated Water-repellent Design</strong></p><ul><li>Thanks to the water-repellent design, you don\'t have to worry about spills and splashes damaging your phones functioning. So, keep taking your calls even during rains or while you are swimming in the pool.</li></ul>', 16900, 0, 145, '#0389a0', 'ProductsImages/Moto_G71_5G_Neptune_Green_128_GB__6_GB_RAM_-_1.jpg', 'ProductsImages/Moto_G71_5G_Neptune_Green_128_GB__6_GB_RAM_-_2.jpg', 'ProductsImages/Moto_G71_5G_Neptune_Green_128_GB__6_GB_RAM_-_3.jpg', 'ProductsImages/Moto_G71_5G_Neptune_Green_128_GB__6_GB_RAM_-_4.jpg', 'ProductsImages/Moto_G71_5G_Neptune_Green_128_GB__6_GB_RAM_-_5.jpg', 0, '5fbf813f2b704cb3930e0257eec8eb24', '27fdfe964cd741399f952585e3cc14ba', '2022-11-13 11:07:32.263403', '2