('7b0790dc5f5e45c09e1a9e4fce0e172a', 'vivo T1 44W (Ice Dawn, 128 GB)  (4 GB RAM)', '<p><strong>Description:</strong></p><ul><li>4 GB RAM | 128 GB ROM | Expandable Upto 1 TB</li><li>16.36 cm (6.44 inch) Full HD+ AMOLED Display</li><li>50MP + 2MP + 2MP | 16MP Front Camera</li><li>5000 mAh Lithium Battery</li><li>Qualcomm Snapdragon 680 Processor</li></ul><p><strong>44W Flash Charging</strong></p><ul><li>Charge your Vivo T1 smartphone in a jiffy, using the 44W Flash Charge feature that lets you recharge your phone up to 50% in about 28 minutes without significant interruptions.</li></ul><p><strong>Captivating Display</strong></p><ul><li>Mesmerize yourself in the world of vivid images that comes with the LTM display, DCI-P3 color gamut, and 408 PPI on this phone. Featuring a touch sampling rate of up to 180Hz, this phone allows you to enjoy smooth scrolling. Sporting an In-Display Fingerprint sensor, this smartphone enables you to log in to your phone instantly.</li></ul><p><strong>Enthralling Processor</strong></p><ul><li>Powered by a Snapdragon 680 processor that utilizes a 6nm design and clock speed of up to 2.4 GHz, this smartphone lets you experience enhanced gaming performance. Also, it offers an increase in single-core CPU performance and increase in overall GPU performance, thus improving your overall mobile phone operating experience.</li></ul><p><strong>Stunning 50 MP Camera</strong></p><ul><li>This smartphone is equipped with a 50 MP main camera that enables you to take HD resolution and professional-grade photos even during dimly lit conditions. Also, it comes with multi-frame noise reduction technology so that you can capture rich details with low noise. And, fitted with a super night mode feature, this mobile phone allows you to capture clear and bright images even during dark environments.</li></ul><p><strong>Monstrous 5000 mAh Battery</strong></p><ul><li>Boasting a 5000 mAh large battery, this smartphone ensures long-lasting power and entertainment throughout the day. Also, it features an Energy Guardian (VEG) and Super Power Saving Mode to let you enjoy a reduced power consumption, thus allowing you to remain connected all day with a single full charge.</li></ul><p><strong>Expanded RAM Capacity</strong></p><ul><li>You can reap the benefits of an expanded 4 GB of RAM that acts as an internal memory to let you seamlessly switch between multiple apps without any lag. Also, it comes with 128 GB of memory storage so that you can store all your necessities with ease.</li></ul><p><strong>Immersive Gaming Mode</strong></p><ul><li>Leveraging the Ultra Game Mode you can get a visually enhanced gaming experience on your phone. Also, it comes with a plethora of features, including 4D Game Vibration, Game Picture-in-Picture and Do Not Disturb, to offer you an immersive gaming experience.</li></ul><p><strong>User-friendly Funtouch OS 12</strong></p><ul><li>This smartphone is supported by an user-friendly Funtouch OS 12 (based on Android 12) that allows you to experience simple touch control, a smart, eye-friendly layout and a functional interface, thus elevating your user experience.</li></ul>', 14499, 0, 140, '#caeaed', 'ProductsImages/vivo_T1_44W_Ice_Dawn_128_GB__4_GB_RAM_-_1.jpg', 'ProductsImages/vivo_T1_44W_Ice_Dawn_128_GB__4_GB_RAM_-_2.jpg', 'ProductsImages/vivo_T1_44W_Ice_Dawn_128_GB__4_GB_RAM_-_3.jpg', 'ProductsImages/vivo_T1_44W_Ice_Dawn_128_GB__4_GB_RAM_-_6.jpg', 'ProductsImages/vivo_T1_44W_Ice_Dawn_128_GB__4_GB_RAM_-_5.jpg', 0, 'ebfb0c4a20114dbdb07ae73148e086f0', '27fdfe964cd741399f952585e3cc14ba', '2022-11-06 18:25:37.740151', '2022-12-02 08:23:14.512296', 'Ice Dawn', 'No', 'No', '4GB', '128GB', 'No'),
