('88f6a413aa664501a85c7b6b33f235ae', 'Boat Wave Beat Smartwatch (Black Strap, Free Size)', '<p><strong>Description:</strong></p><ul><li>1.69 inch Square HD Display</li><li>550 Nits Brightness</li><li>Heart Rate and Blood Oxygen Monitoring</li><li>Health Ecosystem with boAt Crest App</li><li>Touchscreen</li><li>Fitness &amp; Outdoor</li><li>Battery Runtime: Upto 7 days</li></ul>', 1799, 0, 140, '#000000', 'ProductsImages/boAt_Wave_Beat_Smartwatch__Black_Strap_Free_Size_-_1.jpg', 'ProductsImages/boAt_Wave_Beat_Smartwatch__Black_Strap_Free_Size_-_2.jpg', 'ProductsImages/boAt_Wave_Beat_Smartwatch__Black_Strap_Free_Size_-_3.jpg', 'ProductsImages/boAt_Wave_Beat_Smartwatch__Black_Strap_Free_Size_-_4.jpg', 'ProductsImages/boAt_Wave_Beat_Smartwatch__Black_Strap_Free_Size_-_5.jpg', 0, '50b1e7550a9241d6a4f1a0a2789db770', 'a0d38bc8b2894a91b806f3474d6472a1', '2022-11-13 20:54:59.833735', '2022-12-01 16:52:38.841037', 'Black', 'No', 'No', 'No', 'No', 'No'),
('91525c71cfb2437c880d4074259242e6', 'HP Core i3 11th Gen - (8 GB/512 GB SSD/Windows 11 Home) 15s-fr2511TU Thin and Light Laptop (15.6 Inch, Natural Silver, 1.69 Kg, With MS Office)', '<p><strong>Description:</strong></p><ul><li>Stylish &amp; Portable Thin and Light Laptop&nbsp;</li><li>15.6 Inch FHD, micro-edge, anti-glare (Brightness 250 nits, 141 ppi, Color Gamut 45% NTSC)&nbsp;</li><li>Light Laptop without Optical Disk Drive</li></ul>', 41990, 0, 125, '#dbdbd9', 'ProductsImages/HP_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_15s-fr2511TU_Thin_a_WaZDByN.jpg', 'ProductsImages/HP_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_15s-fr2511TU_Thin_a_cXPMtSP.jpg', 'ProductsImages/HP_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_15s-fr2511TU_Thin_a_EYJnDVv.jpg', 'ProductsImages/HP_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_15s-fr2511TU_Thin_a_oilHsuD.jpg', 'ProductsImages/HP_Core_i3_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home_15s-fr2511TU_Thin_a_tsYrXhn.jpg', 0, '7f2148ada8ab455f88e91c6be60148d4', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-13 11:07:32.263403', '2022-12-01 16:52:38.841037', 'Sliver', 'No', 'No', '8GB', '512GB', 'No');
