('942af75348d741c3b254dcba73cc8956', 'Printed Round Neck Black T-Shirt', '<p><strong>Descriptions:</strong></p><ul><li>Men\'s Full sleeve T-shirts from Bliven Clothing Store.&nbsp;</li><li>These T-shirts can be worn as a Daily wear, or can be worn during your Morning walk, Running/Jogging and also during your Exercise and Workouts in the Gym.&nbsp;</li><li>These can also be worn as a Casual Wear for all your Outings.&nbsp;</li><li>Fill your wardrobe with these awesome collections and make your day to day more special.</li></ul>', 269, 0, 120, '#000000', 'ProductsImages/Men_Printed_Round_Neck_Black_T-Shirt_-_1_Ave9HKA.jpg', 'ProductsImages/Men_Printed_Round_Neck_Black_T-Shirt_-_2_3xUIIxj.jpg', 'ProductsImages/Men_Printed_Round_Neck_Black_T-Shirt_-_1_V7WdKIr.jpg', 'noimage.png', 'noimage.png', 0, 'eff03cdc45774d149c33be308b3a7a97', 'ba6d535554ad46cea55f8dd824ef2053', '2022-11-28 19:37:02.908728', '2022-11-28 19:37:03.106206', 'Black', 'boys', 'XS', 'No', 'No', 'No'),
('9d658292a6934e1083c04eb05e7f116a', 'OnePlus Bullets Wireless Z2 Bluetooth Headset  (Acoustic Red, In the Ear)', '<p><strong>Description:</strong></p><ul><li>With Mic: Yes&nbsp;</li><li>Bluetooth version: 5</li></ul>', 1999, 0, 165, '#000000', 'ProductsImages/OnePlus_Bullets_Wireless_Z2_Bluetooth_Headset_-_1.jpg', 'ProductsImages/OnePlus_Bullets_Wireless_Z2_Bluetooth_Headset_-_2.jpg', 'ProductsImages/OnePlus_Bullets_Wireless_Z2_Bluetooth_Headset_-_3.jpg', 'ProductsImages/OnePlus_Bullets_Wireless_Z2_Bluetooth_Headset_-_4.jpg', 'ProductsImages/OnePlus_Bullets_Wireless_Z2_Bluetooth_Headset_-_5.jpg', 0, '4cd685c07d334dbca1e293e4a286e286', 'e6b3d33159974daeb4195eebb634818e', '2022-11-04 08:09:38.796322', '2022-12-01 16:52:38.841037', 'Black', 'No', 'No', 'No', 'No', 'No'),
('9e1c4e11d24742ff97d83c6c6b2bd4e1', 'OnePlus Y1S 108 cm (43 inch) Full HD LED Smart Android TV with Android 11 and Bezel-Less Frame', '<p><strong>Descriptions</strong></p><ul><li>Supported Apps:<ul><li>Netflix&nbsp;</li><li>Prime</li><li>Video</li><li>Disney + Hotstar</li><li>YouTube</li></ul></li><li>Operating System:<ul><li>Android (Google Assistant &amp; Chromecast in-built)</li></ul></li><li>Resolution: Full HD 1920 x 1080 Pixels</li><li>Sound Output: 20 W</li><li>Refresh Rate: 60 Hz</li></ul><p><strong>Other Details</strong></p><ul><li>You can watch your favorite movies, shows, and other content on this OnePlus TV.</li><li>Sporting a slim bezel-less design, this TV is designed to offer an enhanced viewing experience.</li><li>Powered by an AI-driven Gamma Engine, this TV provides lifelike visuals with brilliant colors.</li><li>Moreover, this TV is equipped with powerful speakers that produce clear and immersive sound.</li><li>Besides, its Auto Low Latency Mode (ALLM) gives you an edge over the competition when youre playing games.</li></ul><p><strong>AI-driven Visuals</strong></p><ul><li>Featuring a modern Gamma Engine, the OnePlus TV maximizes the quality by tweaking the image to enhance clarity and ensuring that the visuals look true-to-life. With its vivid colors and dynamic contrast, this TV lets you enjoy engrossing visuals.</li></ul><p><strong>Excellent Audio</strong></p><ul><li>Equipped with speakers that render adequate output, this TV provides crisp high-definition audio. The sound quality is enhanced by Dolby Audio so that you can experience clear and immersive sound in every scene.</li></ul><p><strong>Bezel-less Design</strong></p><ul><li>Stylish and sophisticated, this sleek bezel-less TV delivers an exceptional theatre-like experience. Featuring sharp edges, the minimalist design of this TV is sure to blend in with your decor.</li></ul><p><strong>Android TV 11</strong></p><ul><li>Powered by an Android OS, this TV activates Auto Low Latency Mode (ALLM) when you connect your gaming console through the HDMI port or when you open particular gaming apps. This way, this TVs low latency gives you an advantage over your opponents.</li></ul><p><strong>Inbuilt Chromecast</strong></p><ul><li>Offering native support and a Google Assistant-enabled voice remote control, this TV lets you effortlessly access Google Play, Chromecast, other convenient features, and your favorite content. So, you can enjoy complete control over this television.</li></ul><p><strong>OnePlus Connect 2.0</strong></p><ul><li>With its user-friendly design and OnePlus Connect 2.0, this TV lets you manage, access, and share content seamlessly. Moreover, you can easily use OnePlus Connect 2.0 without even having to connect via a data or Wi-Fi connection.</li></ul><p><strong>Convenient Casting with Miracast</strong></p><ul><li>This TV provides inbuilt support for Miracast, DLNA, and Chromecast, enabling you to cast and stream via the fast and reliable dual-band Wi-Fi connection. So, you can connect your phone, laptop, or tablet to this TV to mirror your favourite content onto a large screen.</li></ul><p><strong>Connect with OnePlus</strong></p><ul><li>You can easily sync your OnePlus device with this TV to enjoy a smart user experience. As the OnePlus Watch puts you in control with Smart Volume Control and Sleep Detection, this TV enters sleep mode when you fall asleep. Moreover, you can quickly and seamlessly pair any OnePlus Buds device, too.</li></ul><p><strong>Smart Manager</strong></p><ul><li>Featuring a Smart Manager, this TV lets you make multiple enhancements to boost its capabilities and durability. You can easily boost this TVs speed, create extra storage space, and do more.</li></ul><p><strong>Oxygen Play 2.0</strong></p><ul><li>You can access up to 17 different content providers in one place and keep up with hit channels and on-demand content, thanks to this TVs user-friendly Oxygen Play 2.0 smart hub.</li></ul>', 24999, 0, 150, '#000000', 'ProductsImages/OnePlus_Y1S_108_cm_43_inch_Full_HD_LED_Smart_Android_TV_with_Android_11_a_FKFbNiV.jpg', 'ProductsImages/OnePlus_Y1S_108_cm_43_inch_Full_HD_LED_Smart_Android_TV_with_Android_11_a_pdwWG7z.jpg', 'ProductsImages/OnePlus_Y1S_108_cm_43_inch_Full_HD_LED_Smart_Android_TV_with_Android_11_a_ASBQsXC.jpg', 'ProductsImages/OnePlus_Y1S_108_cm_43_inch_Full_HD_LED_Smart_Android_TV_with_Android_11_a_jKWzIHx.jpg', 'ProductsImages/OnePlus_Y1S_108_cm_43_inch_Full_HD_LED_Smart_Android_TV_with_Android_11_a_azdJaUd.jpg', 0, '092f22e18c2e46a78146e298450682f0', '55055b8ab844407ea0434de87f500b76', '2022-12-12 21:18:03.061152', '2022-12-01 16:52:38.841037', 'Black', 'No', 'No', 'No', 'No', 'No'),
('9efb9a62ea9d45a3aa6491ee0ac1475d', 'DELL P-series 24 inch Full HD LED Backlit IPS Panel Monitor (P2422H)  (Response Time: 5 ms, 60 Hz Refresh Rate)', '<p><strong>Description:</strong></p><ul><li>Panel Type: IPS Panel&nbsp;</li><li>Screen Resolution Type: Full HD&nbsp;</li><li>Brightness: 250 nits&nbsp;</li><li>Response Time: 5 ms</li><li>Refresh Rate: 60 Hz&nbsp;</li><li>HDMI Ports - 1</li></ul>', 15851, 0, 180, '#000000', 'ProductsImages/DELL_P-series_24_inch_Full_HD_LED_Backlit_IPS_Panel_Monitor_-_1.jpg', 'ProductsImages/DELL_P-series_24_inch_Full_HD_LED_Backlit_IPS_Panel_Monitor_-_2.jpg', 'ProductsImages/DELL_P-series_24_inch_Full_HD_LED_Backlit_IPS_Panel_Monitor_-_4.jpg', 'ProductsImages/DELL_P-series_24_inch_Full_HD_LED_Backlit_IPS_Panel_Monitor_-_3.jpg', 'ProductsImages/DELL_P-series_24_inch_Full_HD_LED_Backlit_IPS_Panel_Monitor_-_5.jpg', 0, 'bb82f33d702d4ced91e3b212abbf5b8f', 'ebe20a4d1124476a90bf8de8860def8e', '2022-11-03 09:17:09.204391', '2022-12-01 16:52:38.841037', 'Black', 'No', 'No', 'No', 'No', 'No'),
('a8e019aee24147c29f26d1614f2d5efc', 'Noise Color Fit Icon 2 1.8 Display, Bluetooth Calling, AI Voice Assistance Smartwatch (Deep Wine Strap, Regular)', '<p><strong>Description:</strong></p><ul><li>1.8 display (500 nits brightness)| Bluetooth calling| AI voice assistant</li><li>100+ cloud-based watch faces| In-built games</li><li>Noise Health SuiteTM (SpO2, 24*7 heart rate tracking, sleep monitor &amp; activity tracker)</li><li>60 sports modes| IP67 waterproof | 7-day battery</li><li>Utility features (stopwatch, alarm, timer, weather, find my phone, camera &amp; music controls)</li><li>NoiseFit Track app</li><li>With Call Function</li><li>Touchscreen</li><li>Fitness &amp; Outdoor</li><li>Battery Runtime: Upto 7 days</li></ul>', 2999, 0, 170, '#67494f', 'ProductsImages/Noise_ColorFit_Icon_2_1.8_Display_Bluetooth_Calling_AI_Voice_Assistance_S_XDy1jzy.jpg', 'ProductsImages/Noise_ColorFit_Icon_2_1.8_Display_Bluetooth_Calling_AI_Voice_Assistance_S_uL5O8gQ.jpg', 'ProductsImages/Noise_ColorFit_Icon_2_1.8_Display_Bluetooth_Calling_AI_Voice_Assistance_S_1pO0UAc.jpg', 'ProductsImages/Noise_ColorFit_Icon_2_1.8_Display_Bluetooth_Calling_AI_Voice_Assistance_S_2M3i7Fd.jpg', 'ProductsImages/Noise_ColorFit_Icon_2_1.8_Display_Bluetooth_Calling_AI_Voice_Assistance_S_GPRR9Ks.jpg', 0, 'dca5183e6965412cb93b728d015eea5d', 'a0d38bc8b2894a91b806f3474d6472a1', '2022-11-13 11:07:32.263403', '2022-12-01 16:52:38.841037', 'Glod', 'No', 'No', 'No', 'No', 'No'),
('a8eca91cb6af4b7c8bd1930038702594', 'Boat Stone 350 10 W Bluetooth Speaker (Blue, Mono Channel)', '<p><strong>Description:</strong></p><ul><li>Power Output (RMS): 10 W&nbsp;</li><li>Battery life: 12hr</li><li>Bluetooth Version: 5&nbsp;</li><li>Wireless range: 10 m&nbsp;</li><li>Wireless music streaming via Bluetooth&nbsp;</li><li>IPX7: Splash and Sweat Shield&nbsp;</li><li>Multiple Connectivity: BT, TF Card and AUX&nbsp;</li><li>It\'s time to enjoy a seamless playback experience courtesy boat Stone 350 10W portable wireless speaker.&nbsp;</li><li>The speaker comes equipped with 1.96 dynamic drivers for an immersive stereo experience.&nbsp;</li><li>It supports instant wireless connectivity with Bluetooth v5.0.&nbsp;</li><li>The speaker pumps out nonstop audio for up to 12 hours on a single full charge.&nbsp;</li><li>Apart from the wireless connectivity it comes equipped with the provision for AUX and TF Card connectivity as well.</li><li>It\'s a cylindrical construct and an IPX7 rated water resistance for a carefree listening time and easy portability.&nbsp;</li><li>Immerse into the realm of Nirvana wherever you go, with boat Stone 350.&nbsp;</li><li>The speaker also supports TWS feature meaning you can connect two Stone 350s and forge them into one for a bigger impact.</li></ul>', 1699, 0, 170, '#05578f', 'ProductsImages/boAt_Stone_350_10_W_Bluetooth_Speaker__Blue_Mono_Channel_-_1.jpg', 'ProductsImages/boAt_Stone_350_10_W_Bluetooth_Speaker__Blue_Mono_Channel_-_2.jpg', 'ProductsImages/boAt_Stone_350_10_W_Bluetooth_Speaker__Blue_Mono_Channel_-_3.jpg', 'ProductsImages/boAt_Stone_350_10_W_Bluetooth_Speaker__Blue_Mono_Channel_-_4.jpg', 'ProductsImages/boAt_Stone_350_10_W_Bluetooth_Speaker__Blue_Mono_Channel_-_5.jpg', 0, '4dbaf4e42fb6440fa3bc672d69c2a0b2', '9b585d8cbb4a44f09cea70335f1108cb', '2022-11-04 08:09:38.796322', '2022-12-01 09:55:15.873176', 'Blue', 'No', 'No', 'No', 'No', 'No'),
('a9cdf8a48d32466aa235010b78825d08', 'SAMSUNG 80 cm (32 Inch) HD Ready LED Smart Tizen TV with 2022 Model', '<p><strong>Description:</strong></p><ul><li>Supported Apps:&nbsp;<ul><li>Netflix</li><li>Prime Video</li><li>Display + Hotstar</li><li>YouTube&nbsp;</li></ul></li><li>Operating System: Tizen&nbsp;</li><li>Resolution: HD Ready 1366 x 768 Pixels&nbsp;</li><li>Sound Output: 20 W&nbsp;</li><li>Refresh Rate: 50 Hz&nbsp;</li><li>Installation:&nbsp;<ul><li>The TV table stand is not included in the box with this model.&nbsp;</li><li>Customers may ask for the tabletop stand or wall mount which will be provided to the customer at the time of installation.&nbsp;</li><li>Please directly call Samsung support (please visit the brand website for toll-free numbers) and provide the product\'s model name as well as the seller\'s details mentioned on the invoice to make the request.</li></ul></li><li>With this Samsung TV, every image on the screen comes to life, giving you a home theatre experience.&nbsp;</li><li>With the HD visual quality of this TV, you can enjoy vibrant movie scenes.&nbsp;</li><li>Additionally, HDR increases the screen\'s brightness and brings out the subtleties of the material.&nbsp;</li><li>Moreover, the Contrast Enhancer on this TV improves contrast and offers superb image quality with increased depth.</li></ul><p><strong>Impeccable HD Picture Quality</strong></p><ul><li>With this Samsung TV\'s high-end HD image quality, you can watch your favorite movies in all their vibrant, clear clarity.</li></ul><p><strong>One Remote Superiority</strong></p><ul><li>You can access a wide variety of content with One Remote. Everything from operating your set-top box to managing applications, your gaming console, and even live TV can be done from the place you\'re sitting.</li></ul><p><strong>Splendid HDR</strong></p><ul><li>High-Dynamic Range boosts your TV\'s brightness so you can see a wide range of colors and fine details even in dimly lit environments.</li></ul><p><strong>ProColor Supremacy</strong></p><ul><li>Watching films with ProColor virtually transports you there. It allows the TV to display a wide variety of colours for optimum image quality and an engaging watching experience.</li></ul><p><strong>Exceptional Ultra Clean View</strong></p><ul><li>This TV\'s Ultra Clean View function produces high-resolution images with minimal distortion by using an innovative algorithm to evaluate the source material and give superior detail.</li></ul><p><strong>Brilliant Contrast Enhancer</strong></p><ul><li>This TV\'s Contrast Enhancer, which enhances contrast and provides excellent picture quality with enhanced depth, helps to bring the dull image to life.</li></ul><p><strong>Sophisticated Connection</strong></p><ul><li>Stay amused at all times by connecting your favorite multimedia and entertainment to your TV and flawlessly watching films, listening to music, or viewing photographs via a USB link.</li></ul><p><strong>High-quality Productivity</strong></p><ul><li>Work from home while watching TV. You can wirelessly mirror your computer\'s display on the TV via Remote Access. From the convenience of your sofa, you can even connect to your office PC to access data or work on projects using Microsoft Office 365.</li></ul><p><strong>Micro Dimming Pro</strong></p><ul><li>Feel the color and detail of the shadows with Micro Dimming Pro, which divides the screen into zones and examines every segment for profound blacks and true whites.</li></ul><p><strong>Dolby Digital Plus</strong></p><ul><li>Thanks to Dolby Digital Plus, you can experience a 360-degree immersive sound system with a 3D sound that is driven by multichannel audio, enabling you to sway with your favorite music.</li></ul><p><strong>Personal Computer Mode</strong></p><ul><li>You can work on presentations, Excel, and Word documents from the cloud using the Personal Computer mode. You can also wirelessly connect your workplace computer or mirror your computer for ease on a huge 