('cb956e9aa1484b66be6011cca24e706f', 'Lenovo IdeaPad Gaming Core i5 11th Gen - (8 GB/512 GB SSD/Windows 11 Home/4 GB Graphics/NVIDIA GeForce GTX 1650) 82K101B6IN|82K101FTIN Gaming Laptop  (15.6 Inch, Shadow Black, 2.25 kg)', '<p><strong>Description:</strong></p><ul><li>NVIDIA GeForce GTX 1650&nbsp;</li><li>15.6 Inch Full HD IPS 250nits Anti-glare, 60Hz, 45% NTSC, DC dimmer&nbsp;</li><li>Light Laptop without Optical Disk Drive&nbsp;</li><li>High-performance and portable, the Lenovo IdeaPad Gaming Laptop offers you the flexibility of use.&nbsp;</li><li>It is suitable for on-the-go gaming because of its sleek and lightweight design, allowing you to bring your high-performance gaming system to your college, or on trips.&nbsp;</li><li>Additionally, this laptop\'s 11th generation Intel processor provides optimal performance.&nbsp;</li><li>The GTX 1650 GPU also offers increased power for demanding gaming and content streaming, thanks to its 3rd generation tensor cores, 2nd generation raytracing, and NVIDIA\'s DLSS, Reflex, Broadcast, and Studio technologies.</li></ul><p><strong>Lightweight and Rugged</strong></p><ul><li>Featuring a sleek and lightweight design, the Lenovo IdeaPad Gaming Laptop is ideal for on-the-go gaming, so you can take your powerful gaming system with you wherever you go.&nbsp;</li><li>With this laptop, you can be confident that it will be durable and portable wherever you go, such as to college, the office, or even the airport.&nbsp;</li><li>This laptop has undergone military specification tests, such as it has withstood exposure to high and low temperatures, temperature shock, drops, and vibrations. So, you may rest assured that this device can offer durable performance in a myriad of environments.</li></ul><p><strong>High Performance</strong></p><ul><li>Equipped with an 11th-generation Intel processor, this laptop delivers powerful performance. In addition, its GTX 1650 GPU, which has 3rd generation tensor cores, 2nd generation raytracing, and NVIDIA\'s DLSS, Reflex, Broadcast, and Studio provides more power for demanding gaming and content streaming.</li></ul><p><strong>Seamless Gaming</strong></p><ul><li>Boasting an up to 39.624 cm (15.6) FHD IPS display, this laptop offers plenty of screen space and ensures that every game and session runs smoothly and without a stutter. Additionally, it has a three-sided narrow bezel for enhanced aesthetics. So, you can enter every game knowing that the pace will be exceptional, without any significant lag.</li></ul><p><strong>Sophisticated Thermals</strong></p><ul><li>Thanks to the new and upgraded thermal system, this laptop facilitates improved ventilation and is built with three heat pipes that dissipate heat in an efficient manner. And, you won\'t have to worry about thermal throttling or overheating when playing your favourite games. Moreover, this laptop\'s large thermal area allows for unhindered performance during every gaming session.</li></ul><p><strong>Fast Typing</strong></p><ul><li>Courtesy of its Legionary TrueStrike keyboard, this laptop has numerous controls, such as dedicated media controls, a number pad, large arrow keys for gaming, up to 1.5 mm key travel, a backlight for use in low-light conditions, and anti-ghosting. So, if you want to play fast-paced multiplayer games, this laptop can help you do so.</li></ul><p><strong>Surround Sound</strong></p><ul><li>Thanks to its two up to 2 W Nahimic speakers, this laptop offers excellent sound for all your requirements. Whether you\'re listening to music, watching a movie, or playing a game, it always delivers authentic surround sound. Moreover, built with Bluetooth sound sharing, surround sound, soundtracking, and night mode, you can enjoy a realistic and life-like experience while playing your favorite games.</li></ul><p><strong>Easy Connectivity</strong></p><ul><li>You can always stay connected with this laptop\'s multiple connectivity choices, which include three USB 3.2 Gen 1 ports, one of which is for data transfer, and an HDMI 2.1 port. It is crucial to maintain one\'s privacy while using a laptop. You can rest easy knowing that you\'re safe from prying eyes, thanks to this laptop\'s camera privacy shutter. Additionally, with this laptop, you can maximize its potential while securing your privacy.</li></ul><p><strong>Endless Entertainment</strong></p><ul><li>If your laptop runs out of power, you can quickly charge it with its rapid charge feature. Its up to 6.5 hours battery life allows you to operate it continuously for an extended period of time. This way, you can have uninterrupted gaming sessions with your friends.</li></ul><p><strong>Gaming Pass</strong></p><ul><li>Using this laptop and the Xbox Gaming Pass\'s ultimate gaming pass, you may join the elite. You can access high-quality games, browse them all, and then start playing in your favourite gaming genre.</li></ul>', 54990, 0, 150, '#000000', 'ProductsImages/Lenovo_IdeaPad_Gaming_Core_i5_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home__t9Lebjg.jpg', 'ProductsImages/Lenovo_IdeaPad_Gaming_Core_i5_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home__blJSXnw.jpg', 'ProductsImages/Lenovo_IdeaPad_Gaming_Core_i5_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home__U6TuFE2.jpg', 'ProductsImages/Lenovo_IdeaPad_Gaming_Core_i5_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home__otF9QBN.jpg', 'ProductsImages/Lenovo_IdeaPad_Gaming_Core_i5_11th_Gen_-_8_GB_512_GB_SSD_Windows_11_Home__2HwLvIT.jpg', 0, '3fc08426d68c4153850c260018f2c315', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-04 08:09:38.796322', '2022-12-01 16:52:38.841037', 'Black', 'No', 'No', '8GB', '512GB', 'No'),
