('d325c817cb074e7e868207b4c17f9cb5', 'acer Ryzen 3 Dual Core 3250U - (8 GB/256 GB SSD/Windows 11 Home) Z2-493 Thin and Light Laptop (14inch, Rose Gold, 1.5 Kg)', '<p><strong>Description</strong></p><ul><li>Stylish &amp; Portable Thin and Light Laptop</li><li>14 inch HD, Acer Comfy View LED-backlit TFT LCD</li><li>Light Laptop without Optical Disk Drive</li><li>Manage your daily work, school assignments, or office tasks like a pro on the Acer Ryzen 3 Dual Core 3250U laptop.&nbsp;</li><li>This laptop is powered by an AMD Ryzen 3000 series processor and AMD Radeon graphics card that delivers unmatched performance regardless of any tasks you do.&nbsp;</li><li>Also, it features an upgradable memory capacity of up to 32 GB to ensure exceptional performance.&nbsp;</li><li>Flaunting a 35.56 cm (14) display and sleek design, this laptop offers stunning visuals and an attractive look.</li></ul><p><strong>Impressive Performance</strong></p><ul><li>Supported by an AMD Ryzen 3000 series processor and AMD Radeon graphics card, the Acer Ryzen 3 Dual Core 3250U laptop will let you accomplish multiple tasks without significant hassles. Also, it comes with a RAM capacity of up to 8 GB, which can be further expanded to 32 GB so that you can easily get through your demanding applications.</li></ul><p><strong>Modest Design</strong></p><ul><li>Sporting a weight of up to 1.5 kg, a 35.56 cm (14) display and a long-life battery, this laptop makes your daily life a breeze. The lightweight design allows you to conveniently carry it no matter where you go.</li></ul><p><br><strong>Massive and Fast Storage</strong></p><ul><li>Boasting high-speed storage of up to 256 GB M.2 PCIe SSD and up to 1TB of HDD, this laptop lets you enjoy plenty of storage to accommodate all your media, work files, and more.</li></ul><p><strong>Seamless Connectivity</strong></p><ul><li>Thanks to the full range of connectivity options, such as Wi-Fi 5 (802.11ac), optimized HD camera and dual microphones, you can indulge in lag-free internet connectivity and enjoy a seamless video calling experience on this laptop.</li></ul><p><strong>Multiple Compatible Ports</strong></p><ul><li>This laptop is equipped with a wide range of connectivity ports, including 3 USB ports, two USB 3.2 Gen 1 and one HDMI that allows you to effortlessly transfer your data at a blazing-fast speed while ensuring convenient connectivity in any situation.</li></ul>', 32990, 0, 150, '#c9cbd6', 'ProductsImages/acer_Ryzen_3_Dual_Core_3250U_-_8_GB_256_GB_SSD_Windows_11_Home_Z2-493_Thi_a1yvrpX.jpg', 'ProductsImages/acer_Ryzen_3_Dual_Core_3250U_-_8_GB_256_GB_SSD_Windows_11_Home_Z2-493_Thi_juQwpta.jpg', 'ProductsImages/acer_Ryzen_3_Dual_Core_3250U_-_8_GB_256_GB_SSD_Windows_11_Home_Z2-493_Thi_gtsSykp.jpg', 'ProductsImages/acer_Ryzen_3_Dual_Core_3250U_-_8_GB_256_GB_SSD_Windows_11_Home_Z2-493_Thi_3ovkp3O.jpg', 'ProductsImages/acer_Ryzen_3_Dual_Core_3250U_-_8_GB_256_GB_SSD_Windows_11_Home_Z2-493_Thi_EoT3L4J.jpg', 0, '7e499a04a9244e26a118dddaa3fce6b2', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-04 08:09:38.796322', '2022-12-08 21:08:38.301559', 'Silver', 'No', 'No', '8GB', '256GB', 'No'),
('dbffcfb9a29346b5aa86b84b8715004a', 'Infinix X1 Slim Series Core i3 10th Gen - (8 GB/256 GB SSD/Windows 11 Home) XL21 Thin and Light Laptop (14-inch, Cosmic Blue, 1.24 kg)', '<p><strong>Descriptions</strong></p><ul><li>Stylish &amp; Portable Thin and Light Laptop</li><li>14-inch FHD, IPS Display (300nits peak brightness, 100% sRGB, NTSC 72%)</li><li>Light Laptop without Optical Disk Drive</li><li>Keep your work peers gazing at you as you carry along the metal crafted and stylish Infinix INBook X1 Slim Laptop to your workplace.</li><li>This laptop features a slim body with a weight of about 1.24 kg and thickness of around 14.8 mm to ensure easy portability and a classy appearance.</li><li>Also, thanks to the 65 W multi-utility USB Type-C fast charger, you can charge your device to up to 60% in about 55 minutes.</li><li>Moreover, utility features such as in-built Windows 11 OS, backlit keyboard, and a Dual-star light camera make it a delight for you to use this laptop.</li></ul><p><strong>Sleek and Elegant Design</strong></p><ul><li>Crafted with a lightweight and slim Al- Alloy metal body, the Infinix INBook X1 Slim Laptop adds a classy and sophisticated look, which is sure to gain the attention of the onlookers wherever you go. And with a weight of merely 1.24 kg and thickness of around 14.8 mm, this laptop makes it easy for you to take with you whenever you are travelling.</li></ul><p><strong>Effortless Fast Charging Adapter</strong></p><ul><li>This laptop comes with a 65 W USB Type-C fast charger that ensures up to 60% charging in 55 minutes, thus freeing you from the worry of constantly plugging in to your charging port. Moreover, this multi-utility charger lets you use it to juice up your smartphone, thus, eliminating the need to carry a separate charger</li></ul><p><strong>Sustainable Battery Life</strong></p><ul><li>Keep yourself entertained for up to 10 hours without the hassle of looking out for a power supply to charge your laptop, thanks to the 50 Wh long-lasting battery capacity. As a result, you can stay connected to your work, study, or your entertainment throughout the day.</li></ul><p><strong>Captivating Display</strong></p><ul><li>Sporting a 35.56 cm (14) FHD display with 100% sRGB Color Gamut and a peak brightness of 300 nits, this laptop renders vibrant, sharp, and accurate colours. Also, it features a sleek 4.7 mm ultra-thin bezel display design to let you take pleasure in an expansive view, this offering an engaging visual experience.</li></ul><p><strong>Enthralling Processor</strong></p><ul><li>Powered by the high-performing Intel Core processor chip, high RAM, ample storage capacity, and 4266 MHz of memory frequency, this laptop allows you to seamlessly browse through multiple apps with minimal lag. Moreover, it is integrated with an NVMe PCIe 3.0 SSD, that lets you enjoy blazing-fast transfer speeds, boot times, and game-loading, thus ensuring a smooth user performance.</li></ul><p><strong>Multiple Connectivity Ports</strong></p><ul><li>Boasting a plethora of USB ports such as 1 x USB-C, 1 x USB-C (Data Transfer), 1 x USB3.0, 1 x HDMI 1.4, dedicated SD Card Slot, one 3.5 mm headset, and microphone jack, this laptop allows you to conveniently accomplish all your personal and business needs. Thus, you do not need a separate dongle to get your things done.</li></ul><p><strong>Integrated Windows 11 OS</strong></p><ul><li>The pre-installed Windows 11 OS Home on this laptop brings about a range of additional utility services tools, and its advanced UI lets you effortlessly complete multiple computing tasks.</li></ul><p><strong>Dazzling Dual-star Light Camera</strong></p><ul><li>Employed with Dual-star LED fill lights in its camera, this laptop ensures a perfect appearance making during a live conference or video chatting.</li></ul><p><strong>Dazzling Dual-star Light Camera</strong></p><ul><li>Employed with Dual-star LED fill lights in its camera, this laptop ensures a perfect appearance making during a live conference or video chatting.</li></ul><p><strong>Immersive Audio Experience</strong></p><ul><li>Thanks to the DTS Audio processing feature, you can indulge in a realistic and extraordinary aural experience. Moreover, this laptop is equipped with four speakers that lets you experience a 360-degree surround sound, thus ensuring an theatrical audio experience.</li></ul>', 29990, 0, 140, '#0d2f5a', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_iyaLiwp.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_gHuWCvl.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_UkYn2P0.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_vONyoJp.jpg', 'ProductsImages/Infinix_X1_Slim_Series_Core_i3_10th_Gen_-_8_GB_256_GB_SSD_Windows_11_Home_wd0cB2m.jpg', 0, 'fb737fdf8fda408ca90881dd93318e87', 'df63aa4ba3d5416cb48b761fd8f63cb6', '2022-11-17 22:52:32.051388', '2022-12-08 21:08:38.301559', 'Blue', 'No', 'No', '8GB', '256GB', 'No'),
