('e6acabbbec35421f9b8de41e0e3155df', 'SONY Alpha ILCE-6400 Mirrorless Camera (Body Only) (Black)', '<p><strong>Description:</strong></p><ul><li>Effective Pixels: 24.2 MP&nbsp;</li><li>Sensor Type: CMOS&nbsp;</li><li>Wi-Fi Available&nbsp;</li><li>NTSC/PAL&nbsp;</li><li>Boasting a 24.2-megapixel Exmor CMOS Sensor, this Sony camera delivers low-noise images with picture-perfect clarity.&nbsp;</li><li>And, since, this camera also boasts an automatic subject motion tracker, it helps you maintain a constant focus on your subjects so that you can capture crystal-clear images/videos of them, even when theyre in motion.</li></ul>', 72990, 0, 130, '#000000', 'ProductsImages/SONY_Alpha_ILCE-6400_Mirrorless_Camera_Body_Only__Black_-_1.jpg', 'ProductsImages/SONY_Alpha_ILCE-6400_Mirrorless_Camera_Body_Only__Black_-_2.jpg', 'ProductsImages/SONY_Alpha_ILCE-6400_Mirrorless_Camera_Body_Only__Black_-_4.jpg', 'ProductsImages/SONY_Alpha_ILCE-6400_Mirrorless_Camera_Body_Only__Black_-_5.jpg', 'ProductsImages/SONY_Alpha_ILCE-6400_Mirrorless_Camera_Body_Only__Black_-_6.jpg', 0, '5f2306e789d44de283d220d592450b78', 'fe5046eda18943cd87dd4e283c5a9152', '2022-11-04 08:09:38.796322', '2022-12-01 09:55:15.873176', 'Black', 'No', 'No', 'No', 'No', 'No'),
('e8d019cc360c4811922116306f79d2f1', 'HP Pavilion Core i5 (4 GB DDR4/1 TB/Windows 10 Home/2 GB 2 GB DDR5 GFX/23.8 Inch Screen/24F0043IN)  (Snow white, 41.95 cm x 54.09 cm x 20.41 cm, 5.92 kg)', '<p><strong>Description:</strong></p><ul><li>Windows 10 Home&nbsp;</li><li>NVIDIA Core i5&nbsp;</li><li>HDD Capacity 1 TB&nbsp;</li><li>RAM 4 GB DDR4&nbsp;</li><li>23.8-inch Display</li></ul>', 67490, 0, 80, '#000000', 'ProductsImages/HP_Pavilion_Core_i5_4_GB_DDR4_1_TB_Windows_10_Home_2_GB_2_GB_DDR5_GFX_23._yszpEEY.jpg', 'ProductsImages/HP_Pavilion_Core_i5_4_GB_DDR4_1_TB_Windows_10_Home_2_GB_2_GB_DDR5_GFX_23._ccru9PR.jpg', 'ProductsImages/HP_Pavilion_Core_i5_4_GB_DDR4_1_TB_Windows_10_Home_2_GB_2_GB_DDR5_GFX_23._K7VIwVw.jpg', 'ProductsImages/HP_Pavilion_Core_i5_4_GB_DDR4_1_TB_Windows_10_Home_2_GB_2_GB_DDR5_GFX_23._bgfLOpf.jpg', 'ProductsImages/HP_Pavilion_Core_i5_4_GB_DDR4_1_TB_Windows_10_Home_2_GB_2_GB_DDR5_GFX_23._blxDrA9.jpg', 0, '61fdea34b3574c66b395ec13f258729f', '349506670a8f4d49b21ca155408ab88c', '2022-11-13 09:46:09.078991', '2022-12-01 16:52:38.841037', 'white', 'No', 'No', '4GB', '1TB', 'No'),
('ea6874ea6b774accad0495174392b045', 'HP x1000 Wired Optical Mouse  (USB 2.0, Black)', '<p><strong>Description:</strong></p><ul><li>Wired&nbsp;</li><li>Interface: USB 2.0&nbsp;</li><li>Optical Mouse</li><li>Whether you have a laptop or desktop, a mouse plays an important role because without it operating your device could be quite difficult.&nbsp;</li><li>Well, if youre looking to buy a new mouse or replace the old one, this Optical Mouse from HP can be a great choice.</li></ul><p><strong>Easy to Connect</strong></p><ul><li>With the help of USB connectivity, you can easily connect it to your laptop or desktop and start using it within seconds as you dont have to install software or a drive. This 3-button mouse has a scroll wheel that lets you easily scroll through files. With optical sensor, it works on almost any surface.</li></ul><p><strong>Stylish Mouse</strong></p><ul><li>This sleek and modern mouse can add a touch of style to your workspace. It also has a curvy design that gives it a stylish shape and also makes it comfortable to use.</li></ul>', 269, 0, 140, '#000000', 'ProductsImages/HP_x1000_Wired_Optical_Mouse__USB_2.0_Black_-_1.jpg', 'ProductsImages/HP_x1000_Wired_Optical_Mouse__USB_2.0_Black_-_2.jpg', 'ProductsImages/HP_x1000_Wired_Optical_Mouse__USB_2.0_Black_-_3.jpg', 'ProductsImages/HP_x1000_Wired_Optical_Mouse__USB_2.0_Black_-_4.jpg', 'ProductsImages/HP_x1000_Wired_Optical_Mouse__USB_2.0_Black_-_5.jpg', 0, 'aae7b31485664d72b409a8c6711230bb', '11e812039e124406b9762fc69309361a', '2022-11-18 09:38:51.055965', '2022-12-01 09:55:15.873176', 'Black', 'No', 'No', 'No', 'No', 'No'),
('ea8547c7eb9d458eb69b7bf894110254', 'APPLE Watch Series7 (GPS, 45mm) - Blue Aluminium Case with Abyss Blue Sport Band  (Blue Strap, Regular)', '<p><strong>Description:</strong></p><ul><li>Stay connected to family and friends with calls, texts and email, even when you don\'t have your phone</li><li>Stream music and podcasts on the go and leave your phone at home</li><li>Always-on Retina display has nearly 20% more screen area than Series 6 making everything easier to see and use</li><li>The most crack-resistant front crystal yet on an Apple Watch, IP6X dust resistance and swimproof design</li><li>Measure your blood oxygen with a powerful sensor and app</li><li>Take an ECG anytime and anywhere</li><li>Get high and low heart rate and irregular heart rhythm notifications</li><li>With Call Function</li><li>Touchscreen</li><li>Watchphone, Notifier, Fitness &amp; Outdoor</li><li>Battery Runtime: Upto 18 hrs</li></ul>', 43899, 0, 190, '#303f51', 'ProductsImages/APPLE_Watch_Series7_1.jpg', 'ProductsImages/APPLE_Watch_Series7_2.jpg', 'ProductsImages/APPLE_Watch_Series7_5.jpg', 'ProductsImages/APPLE_Watch_Series7_6.jpg', 'ProductsImages/APPLE_Watch_Series7_7.jpg', 0, '9cc8f1d74a5c4879987d9747d489a139', 'a0d38bc8b2894a91b806f3474d6472a1', '2022-10-28 08:41:09.403980', '2022-12-01 16:52:38.841037', 'Blue', 'No', 'No', 'No', 'No', 'No'),
('f3141d0ee0b2440ab291bbc6282e1df2', 'Printed Round Neck Black T-Shirt', '<p><strong>Description:</strong></p><ul><li>Men\'s Full sleeve T-shirts from Bliven Clothing Store.&nbsp;</li><li>These T-shirts can be worn as a Daily wear, or can be worn during your Morning walk, Running/Jogging and also during your Exercise and Workouts in the Gym.&nbsp;</li><li>These can also be worn as a Casual Wear for all your Outings.&nbsp;</li><li>Fill your wardrobe with these awesome collections and make your day to day more special.</li></ul>', 269, 0, 130, '#db9602', 'ProductsImages/Printed_Men_Round_Neck_Yellow_T-Shirt_-_1.jpg', 'ProductsImages/Printed_Men_Round_Neck_Yellow_T-Shirt_-_2.jpg', 'ProductsImages/Printed_Men_Round_Neck_Yellow_T-Shirt_-_1_VNthJ43.jpg', 'noimage.png', 'noimage.png', 0, 'eff03cdc45774d149c33be308b3a7a97', 'ba6d535554ad46cea55f8dd824ef2053', '2022-11-03 09:17:09.204391', '2022-11-28 21:44:52.739352', 'Yellow', 'boys', 'XS', 'No', 'No', 'No'),
('f5df11e334cf447b97a0d9f10ef3fb80', 'DELL MS 116 Wired Optical Mouse  (USB, Black)', '<p><strong>Description:</strong></p><ul><li>Wired&nbsp;</li><li>Interface: USB&nbsp;</li><li>Optical Mouse</li><li>Improve your productivity in front of your computer with the Dell MS 116 Wired Optical Mouse that features an Optical LED Tracking with 1000 DPI and Wired Connectivity.</li></ul><p><strong>Comfortable Grip</strong></p><ul><li>The shape and size of this mouse have been designed to fit the contours of hands for an easy and comfortable grip while working with the two buttons and the scroll wheel.</li></ul><p><strong>Compatibility</strong></p><ul><li>This computer accessory is compatible with most devices that come with a USB port.</li></ul><p><strong>Plug and Play</strong></p><ul><li>Just plug into a USB port of your personal computer or laptop and start using it.</li></ul><p><strong>Ideal for</strong></p><ul><li>You can use this mouse on your home computer, laptop, and even in your workplace. This is a reliable, comfortable device that you can conveniently carry along.</li></ul>', 299, 0, 70, '#000000', 'ProductsImages/DELL_MS_116_mouse_1.png', 'ProductsImages/DELL_MS_116_mouse_2.png', 'ProductsImages/DELL_MS_116_mouse_3.png', 'ProductsImages/DELL_MS_116_mouse_4.png', 'ProductsImages/DELL_MS_116_mouse_5.png', 0, '11bea6ebee0e47a1a135dd170f11b009', '11e812039e124406b9762fc69309361a', '2022-11-18 09:38:51.055965', '2022-12-01 09:55:15.873176', 'Black', 'No', 'No', 'No', 'No', 'No'),
('f8032179bacf4ac29a782b20d72c8e0f', 'Color Block Men Round Neck Grey T-Shirt', '<p><strong>Description:</strong></p><ul><li>Designed with best-in-class Technology, this T-shirt is Manufactured with finest fabric for long lasting comfort and never faded colors, as it dyed with refining dye technology, that makes colors look like new even after long washes. As this t-shirt passed various quality checks the accurate colors and fitting is what makes this even more unique and beautiful.</li></ul>', 279, 0, 120, '#52535a', 'ProductsImages/Color_Block_Men_Round_Neck_Grey_T-Shirt_-_1.jpg', 'ProductsImages/Color_Block_Men_Round_Neck_Grey_T-Shirt_-_2.jpg', 'ProductsImages/Color_Block_Men_Round_Neck_Grey_T-Shirt_-_3.jpg', 'noimage.png', 'noimage.png', 0, 'eff03cdc45774d149c33be308b3a7a97', 'ba6d535554ad46cea55f8dd824ef2053', '2022-11-03 09:17:09.204391', '2022-12-02 08:23:14.512296', 'Gray', 'man', 'XXL', 'No', 'No', 'No'),
('f8ed6d003bf44cfb98079ee0823d1325', 'ENTWINO Mouse, Laptop Mouse, Computer Mouse, Wired USB Mouse, 6 buttons Optical Mouse With RGB Lights Wired Optical Mouse  (USB 2.0, Black)', '<p><strong>Description:</strong></p><ul><li>Wired&nbsp;</li><li>Interface: USB 2.0&nbsp;</li><li>Optical Mouse</li></ul>', 499, 0, 180, '#000000', 'ProductsImages/ENTWINO_Mouse_Laptop_Mouse_Computer_Mouse_Wired_USB_Mouse_6_buttons_Optic_BpS5y1B.jpg', 'ProductsImages/ENTWINO_Mouse_Laptop_Mouse_Computer_Mouse_Wired_USB_Mouse_6_buttons_Optic_F2hM0qn.jpg', 'ProductsImages/ENTWINO_Mouse_Laptop_Mouse_Computer_Mouse_Wired_USB_Mouse_6_buttons_Optic_EUC8c1G.jpg', 'ProductsImages/ENTWINO_Mouse_Laptop_Mouse_Computer_Mouse_Wired_USB_Mouse_6_buttons_Optic_AveHdpK.jpg', 'noimage.png', 0, 'ca8edd56eeb243b9b8ab0ea611f40e87', '11e812039e124406b9762fc69309361a', '2022-11-18 09:38:51.055965', '2022-12-01 09:55:15.873176', 'Black', 'No', 'No', 'No', 'No', 'No'),
('fb47dbdabe274c589a37faefa4b1e5a6', 'HP All-in-One 22 Ryzen 3 Dual Core (8 GB DDR4/1 TB/Windows 11 Home/21.5 Inch Screen/All-in-One 22-df0202in)  (snow white)', '<p><strong>Description:</strong></p><ul><li>Windows 11 Home&nbsp;</li><li>AMD Ryzen 3 Dual Core&nbsp;</li><li>HDD Capacity 1 TB&nbsp;</li><li>RAM 8 GB DDR4&nbsp;</li><li>21.5-inch Display</li></ul>', 47500, 0, 105, '#000000', 'ProductsImages/HP_All-in-One_22_Ryzen_3_Dual_Core_8_GB_DDR4_1_TB_Windows_11_Home_21.5_In_g6EE6cg.jpg', 'ProductsImages/HP_All-in-One_22_Ryzen_3_Dual_Core_8_GB_DDR4_1_TB_Windows_11_Home_21.5_In_u2yoZCu.jpg', 'ProductsImages/HP_All-in-One_22_Ryzen_3_Dual_Core_8_GB_DDR4_1_TB_Windows_11_Home_21.5_In_IlW1EX7.jpg', 'noimage.png', 'noimage.png', 0, '61fdea34b3574c66b395ec13f258729f', '349506670a8f4d49b21ca155408ab88c', '2022-11-13 09:46:09.078991', '2022-12-01 16:52:38.841037', 'white', 'No', 'No', '8GB', '1TB', 'No'),
('fb4de106784e4019b621f2581b6d2ad7', 'Google Nest Mini (2nd Gen) with Google Assistant with Google Assistant Smart Speaker (Charcoal)', '<p><strong>Description:</strong></p><ul><li>Voice activated smart speaker with the Google Assistant&nbsp;</li><li>Available in Hindi&nbsp;</li><li>2X stronger bass than Google Home Mini&nbsp;</li><li>Wall-mount ready&nbsp;</li><li>Play music, control other smart devices in home&nbsp;</li><li>Wireless music streaming via Bluetooth&nbsp;</li><li>Configuration: Mono&nbsp;</li><li>This device is compatible with Smart TVs that have built-in Chromecast.</li><li>Right from when you wake up till when you go to bed, the Google Nest Mini acts as your personal assistant keeping you informed and entertained throughout the day.&nbsp;</li><li>Apart from providing you with your personalized schedule and reminders and giving weather updates to letting you play your favorite songs on various streaming services; the Nest Mini is here to make your day better!</li></ul><p><strong>Smart Speaker with the Google Assistant, in Hindi Too</strong></p><ul><li>You can now control the 2nd generation Nest Mini with just your voice. All you have to do is say Ok Google to play songs, get weather updates, news, and almost anything, and all these in Hindi too. Apart from hearing your personalized schedule, commute, and reminders, you can also set timers and alarms, and control your compatible smart devices.</li></ul><p><strong>Better Sound, All-around</strong></p><ul><li>With 2X stronger bass than the Google Home Mini, your music will sound better and richer.</li></ul><p><strong>Wall-mount Ready</strong></p><ul><li>The Nest Mini can be easily hung on the wall in your kitchen, bedroom, living room, or hallway. Being easy to mount and easy to reach, it never gets in the way.</li></ul><p><strong>Stream Music with Your Voice</strong></p><ul><li>Whether you want to play your favorite songs from YouTube Music, Gaana, JioSaavn, or Spotify, or stream music from your phone to Nest Mini, you just have to ask your Google Assistant.</li></ul><p><strong>Control Your Home with Just Your Voice</strong></p><ul><li>Your voice is all you need to dim the lights, pause the TV, or turn on the AC as the Nest Mini is compatible with several popular smart devices such as lights, ACs, and TVs from your favourite brands.</li></ul><p><strong>The Google Assistant is Always Ready to Help</strong></p><ul><li>From getting weather updates, and the news to setting timers and alarms, just ask and get the best of Google.</li></ul><p><strong>Voice Match</strong></p><ul><li>Get personalized schedules, commute times, reminders, and more, thanks to the Voice Match feature.</li></ul><p><strong>Thoughtfully Designed for Every Room</strong></p><ul><li>Blending right into your home, the Nest Mini looks great on a bedside table or shelf and even on the wall. Whether its a hallway, living room, bedroom, or the kitchen, each color complements the decor.</li></ul><p><strong>Family-friendly</strong></p><ul><li>Getting your family to the dining table on time is made easy as you can broadcast messages from your phone to everyone at home. You can even chat between rooms with other Google Home and Nest speakers or displays.</li></ul>', 3499, 0, 130, '#000000', 'ProductsImages/Google_Nest_Mini_2nd_Gen_with_Google_Assistant_with_Google_Assistant_Smar_1HcHXQL.jpg', 'ProductsImages/Google_Nest_Mini_2nd_Gen_with_Google_Assistant_with_Google_Assistant_Smar_fXNCESM.jpg', 'ProductsImages/Google_Nest_Mini_2nd_Gen_with_Google_Assistant_with_Google_Assistant_Smar_WuHISIf.jpg', 'ProductsImages/Google_Nest_Mini_2nd_Gen_with_Google_Assistant_with_Google_Assistant_Smar_K1mG6rF.jpg', 'ProductsImages/Google_Nest_Mini_2nd_Gen_with_Google_Assistant_with_Google_Assistant_Smar_0Dyyurq.jpg', 0, 'e0e8c70e57424cdda15c57e5671a5c12', '9b585d8cbb4a44f09cea70335f1108cb', '2022-11-04 08:09:38.796322', '2022-12-01 09:55:15.873176', 'Black', 'No', 'No', 'No', 'No', 'No');
